import React from "react";
import {Component} from "react";
import jsondata from "./data.json";


class Homepage extends Component {

      render(){
          return (
            <section>
            <div>
            <h1>Recomended For You</h1>
          {
            jsondata[7].Recomended.map((data,i) => {
            return (
            <img key={i} src={data} style={{"height":"200px","width":"200px"}}/>
            )
            })
           }
           <h1>Your Daily Mix</h1>
          {
            jsondata[8].DailyMix.map((data,i) => {
            return (
            <img key={i} onClick={this.props.selected} src={data} style={{"height":"200px","width":"200px"}}/>
            )
            })
           }
            </div>
            </section>
        )
      }
}

export default Homepage
